pragma solidity ^0.5.0;

contract GenerateAvatar {
  struct Avatar
  {
    uint id;
    string name;
    string class;

  }

  Avatar[] avatars;

  constructor() public {

    addAvatars ("A","Common"); //1
    addAvatars ("B","Common"); //2
    addAvatars ("C","Common"); //3
    addAvatars ("D","Common"); //4
    addAvatars ("E","Uncommon"); //5
    addAvatars ("F","Uncommon"); //6
    addAvatars ("G","Uncommon"); //7
    addAvatars ("H","Rare"); //8
    addAvatars ("I","Rare"); //9
    addAvatars ("Z","Special"); //10

  }

  function addAvatars (string memory _name, string memory _class) public {
    uint _id = getIndex();
    avatars.push(Avatar({ //Pushing our avatars into array
      id: _id,
      name: _name,
      class: _class
      }));

  }

  function getIndex() view public returns (uint){
    return avatars.length; //Need to make a function return avatars.length
  }

  function rngAvatar() view public returns(string memory, string memory){
    uint rng = random();
    return(avatars[rng].name,avatars[rng].class); //Returns rng avatar name & class
  }

  function random() private view returns (uint) {
    return uint(blockhash(block.number-1))%10; //Take random number from 0-9 using the block.number
  }
}
